.board, img, textarea{
    color:white;
}

@import url('https://fonts.googleapis.com/css2?family=Caveat&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Homemade+Apple&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Nothing+You+Could+Do&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Reenie+Beanie&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Dawning+of+a+New+Day&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Piazzolla&display=swap');

.board, img, textarea{
float:left;
width:128px;
height:128px;
resize: inherit;
overflow:hidden;
background-color:transparent;
user-select: none; 
z-index:9999;
border:0;
color:#343c45;
border-radius:10px;
font-family: 'Caveat', cursive;
font-weight:600;
line-height:17px;
opacity:.8;
}
textarea{
    z-index:999999;
    font-size:18px;
    margin:10px;
    width:108px;
    height:108px;
     cursor:pointer;
}
.imgclass{
    cursor:pointer;
}

.imgclass:hover{
    opacity:1;
}
.imgclass:active{
    opacity:1;
}
textarea:hover{
    color:black;
}
.metabox{
    background-color:#e0e0d5;
    font-family:Arial, Helvetica, sans-serif;
    color:#777;
    font-weight:200;
    border-radius:3px;
    display: flex;
  justify-content: center;
  align-items: center;
    text-align:center;
    box-shadow:inset 0 0 30px 0 rgba(1,1,1,.2);
}
#originText{
    width:50%;
    height:auto;
}

.outlink{
    color:black;
    display:inline-block;
    cursor:pointer;
    height:210px;
    width:130px;
    font-family:Piazzolla;
    font-size:11px;
    letter-spacing: 2px;
    text-align:center;
    margin:0 10px;
    padding: 0 20px;
    transition: all .1s ease-in-out;
    border-radius:10px;
    border:0 white solid;
}   
a{
    text-decoration: none;
}
.outlink img{
  text-align:center;
  display:inline;
}
.outlink p{
    display:inline-block;
    color:black;
    transition: all .1s ease-in-out;
}
.outlink:hover{
    box-shadow:0 10px 60px 0 rgba(1,1,1,.1);
}
.outlink:hover p{
    opacity:.5;
    margin-top:5px;
}



#quitter{
background-image:url('https://static.thenounproject.com/png/1890872-200.png');
border-radius: 0  0  0  10px;
right:0;
position:absolute;
}

#door{
    z-index:9999999;
text-align:center;
display:inline-block;
font-family:Piazzolla;
letter-spacing:30px;
margin-top:30vh;
font-size:100px;
font-weight: 100;
transition: all .3s ease-in-out;
color:#616161;
cursor:pointer;
}
#door:hover, #door:hover b, #door:hover i{
  color:black; 
}


#door:hover{
    letter-spacing:60px;
}
b, i{
    color:#616161;
    font-family:Georgia;
}

.btn{
   margin:10px;
    transition: all .1s ease-in-out;
    position:absolute;z-index:99999999999;
height:50px; width:50px; 
background-size:30%; background-repeat:no-repeat; background-position:center;
background-color:#e0e0d5;
box-shadow:0 0 15px 5px rgba(1,1,1,.1);
cursor:pointer;
opacity:1; 
}

.btn:hover{
    box-shadow:inset 0 0 5px 0 rgba(1,1,1,.4);
    background-color:#4287f5;
}
.menubtn{
    float:left;
    position:relative;
    margin:2px 10px;
}
video{
    height: 100%;
    width: 177.77777778%; /* 100 * 16 / 9 */
    min-width: 100%;
    left:-50%;
}

video:hover{
    opacity:.9;
    cursor:pointer;
}
